sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'zone', 'name']);
    gcc.maptoOutputFromInput(inputs, outputs, ['projectid', 'zone']);
    var requestBody = {
        "name": inputs.name,
        "description": inputs.description
    }
    if (inputs.sizeGb)
        requestBody.sizeGb = inputs.sizeGb;
    if (inputs.physicalBlockSizeBytes)
        requestBody.physicalBlockSizeBytes = inputs.physicalBlockSizeBytes;
    if (inputs.licenses.length > 0 && inputs.licenses[0])
        requestBody.licenses = inputs.licenses;
    if (inputs.licenseCodes.length > 0 && inputs.licenses[0])
        requestBody.licenseCodes = inputs.licenseCodes;
    if (inputs.diskEncryptionKey)
        requestBody.diskEncryptionKey = inputs.diskEncryptionKey;
    if (inputs.type)
        requestBody.type = "projects/" + inputs.projectid + "/zones/" + inputs.zone + "/diskTypes/" + inputs.type;
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

